import TopTitle from "../parts/dom/Header";
import LogInForm from "../parts/forms/LogInForm";
import Footer from "../dom/Footer";

const LogInPage = () => {

  return (
    <>
      <TopTitle />
      <LogInForm />
      <Footer />
    </>
  );
};

export default LogInPage;
